css:
atom-text-editor,
:host {
  background-color: #193549;
  color: #ffffff;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #193549;
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #1f4662;
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #ffffff;
}
atom-text-editor .gutter .line-number.folded .icon-right:before,
:host .gutter .line-number.folded .icon-right:before,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #ffc600;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(252, 253, 253, 0.15) !important;
  color: #3b5364;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #3b5364;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #3b5364;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #ffc600;
  z-index: 0;
}
atom-text-editor .highlights .highlight-selected .region.region.region,
:host .highlights .highlight-selected .region.region.region {
  border-color: #ffc600;
}
atom-text-editor .find-result .region,
:host .find-result .region {
  background-color: transparent;
  border-color: #ffc600;
}
atom-text-editor .current-result .region,
:host .current-result .region {
  border-color: #ffffff;
  z-index: 0;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #ffc600;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #0050a4;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #1f4662;
}
.punctuation:not(.punctuation.definition.string .punctuation.definition.comment) {
  color: #E1EFFF;
}
.constant {
  color: #FF628C;
}
.entity {
  color: #ffc600;
}
.keyword {
  color: #FF9D00;
}
.storage {
  color: #ffc600;
}
.string,
.string.unquoted.heredoc .string {
  color: #3AD900;
}
.string.unquoted.old-plist {
  color: #ffffff;
}
.comment {
  font-style: italic;
  color: #0088FF;
}
.support {
  color: #80FFBB;
}
.variable {
  color: #CCCCCC;
  background-color: #0d3a58;
}
.cursor-line .variable {
  background: transparent;
}
.has-selection .variable {
  background: transparent;
}
.variable.language {
  color: #FF80E1;
}
.meta.function-call {
  color: #FFEE80;
}
.meta.function-call .meta.brace.round,
.meta.function-call .punctuation.definition.arguments.bracket.round {
  color: #ffffff;
}
.invalid {
  color: #F8F8F8;
  background-color: #800F00;
}
.entity.other.inherited-class {
  font-style: italic;
  color: #80FCFF;
}
.string.quoted .source {
  color: #9EFF80;
}
.string .constant {
  color: #80FF82;
}
.string.regexp {
  color: #80FFC2;
}
.string .variable {
  color: #EDEF7D;
}
.support.function {
  color: #FFB054;
}
.support.constant {
  color: #EB939A;
}
.support.type.exception {
  color: #FF1E00;
}
.meta.preprocessor.c {
  color: #8996A8;
}
.meta.preprocessor.c .keyword {
  color: #AFC4DB;
}
.meta.sgml.html .meta.doctype,
.meta.sgml.html .meta.doctype .entity,
.meta.sgml.html .meta.doctype .string,
.meta.xml-processing,
.meta.xml-processing .entity,
.meta.xml-processing .string {
  color: #73817D;
}
.meta.tag,
.meta.tag .entity {
  color: #9EFFFF;
}
.meta.tag .punctuation {
  color: #fff;
}
.meta.selector.css .entity.name.tag {
  color: #9EFFFF;
}
.meta.selector.css .entity.other.attribute-name.id {
  color: #FFB454;
}
.meta.selector.css .entity.other.attribute-name.class {
  color: #5FE461;
}
.support.type.property-name.css {
  color: #9DF39F;
}
.meta.property-group .support.constant.property-value.css,
.meta.property-value .support.constant.property-value.css {
  color: #F6F080;
}
.meta.preprocessor.at-rule .keyword.control.at-rule {
  color: #F6AA11;
}
.meta.property-value .support.constant.named-color.css,
.meta.property-value .constant {
  color: #EDF080;
}
.meta.constructor.argument.css {
  color: #EB939A;
}
.meta.diff,
.meta.diff.header {
  color: #F8F8F8;
  background-color: #000E1A;
}
.markup.deleted {
  color: #F8F8F8;
  background-color: #ee3a43;
}
.markup.changed {
  color: #F8F8F8;
  background-color: #806F00;
}
.markup.inserted {
  color: #F8F8F8;
  background-color: #154F00;
}
.markup.raw {
  background-color: rgba(143, 221, 246, 0.19);
}
.cursor-line .markup.raw {
  background: transparent;
}
.has-selection .markup.raw {
  background: transparent;
}
.markup.quote {
  background-color: #004480;
}
.cursor-line .markup.quote {
  background: transparent;
}
.has-selection .markup.quote {
  background: transparent;
}
.markup.list {
  background-color: #1D425D;
}
.cursor-line .markup.list {
  background: transparent;
}
.has-selection .markup.list {
  background: transparent;
}
.markup.bold {
  font-weight: bold;
  color: #C1AFFF;
}
.markup.italic {
  font-style: italic;
  color: #B8FFD9;
}
.markup.heading {
  font-weight: bold;
  color: #C8E4FD;
  background-color: #001221;
}
.cursor-line .markup.heading {
  background: transparent;
}
.has-selection .markup.heading {
  background: transparent;
}
.sublimelinter.annotations {
  color: #FFFFFF;
  background-color: #FFFFAA;
}
.sublimelinter.mark.error {
  color: #DA2000;
}
.sublimelinter.outline.illegal {
  color: #FFFFFF;
  background-color: #FF4A52;
}
.sublimelinter.underline.illegal {
  background-color: #FF0000;
}
.sublimelinter.gutter-mark {
  color: #FFFFFF;
}
.sublimelinter.mark.warning {
  color: #EDBA00;
}
.sublimelinter.outline.warning {
  color: #FFFFFF;
  background-color: #DF9400;
}
.sublimelinter.underline.warning {
  background-color: #FF0000;
}
.sublimelinter.outline.violation {
  color: #FFFFFF;
  background-color: #ffffff;
}
.sublimelinter.underline.violation {
  background-color: #FF0000;
}
.entity.name.class.php,
.entity.name.type.class.php {
  color: #80FFC2;
}
.entity.name.function.php {
  background-color: #333333;
}
.cursor-line .entity.name.function.php {
  background: transparent;
}
.has-selection .entity.name.function.php {
  background: transparent;
}
.markup.deleted.git_gutter {
  color: #F92672;
}
.markup.inserted.git_gutter {
  color: #A6E22E;
}
.markup.changed.git_gutter {
  color: #967EFB;
}
.markup.ignored.git_gutter {
  color: #565656;
}
.markup.untracked.git_gutter {
  color: #565656;
}
.brackethighlighter.tag {
  color: #1f4662;
}
.brackethighlighter.curly {
  color: #ffc600;
}
.brackethighlighter.round {
  color: #ffc600;
}
.brackethighlighter.square {
  color: #ffc600;
}
.brackethighlighter.angle {
  color: #FFDD00;
}
.brackethighlighter.quote {
  color: #ffc600;
}
.brackethighlighter.unmatched {
  color: #F92672;
}
.storage.type.function.js {
  color: #ffa5f3;
  background-color: #1d3c52;
}
.cursor-line .storage.type.function.js {
  background: transparent;
}
.has-selection .storage.type.function.js {
  background: transparent;
}
.punctuation.definition.string.begin.js,
.punctuation.definition.string.end.js {
  color: #2eff00;
}
.object.key.js .string.unquoted.js {
  color: #2AFFDF;
}
.entity.name.class.js,
.entity.name.type.class.js {
  color: #FB94FF;
}
.storage.type.class.js {
  color: #FF9D00;
}
.storage.type.extends.js,
.storage.modifier.extends.js {
  font-style: italic;
}
.punctuation.separator.key-value.css {
  color: #ffc600;
}
.variable.unordered.list.gfm,
.support.quote.gfm {
  color: #ffc600;
}
.comment.quote.gfm {
  color: #ffffff;
  font-style: normal;
}
.markup.underline.link.gfm {
  font-style: italic;
  color: #FF628C;
}
.markup.underline.link.gfm .punctuation.definition.gfm {
  color: #ffffff;
  font-style: normal;
}
.entity.other.attribute-name.html,
.entity.other.attribute-name.event.html,
.entity.other.attribute-name.id.html,
.entity.other.attribute-name.tag.jade,
.constant.other.symbol.ruby,
.entity.other.attribute-name.jsx {
  font-style: italic;
  color: #ffc600;
}
